(244, 85, '<p><span class="wysiwyg-color-white">The other route was even more exciting. He had to travel through dried river beds into the Erongo Mountains over the sand, rubble and rocks for an exotic surprise dinner at the top of the rocky hill. It was definitely one of the most unexpected and very memorable moments from this journey.</span></p><span class="wysiwyg-color-white">\r\n</span><p><span class="wysiwyg-color-white">After the joyful under the starry-skied dinner, Yennas couldn''t hide his amazement when he visited the Sandwich Harbor on the next day. Its a towering giant sand dunes that run straight into the ocean, yes, the famous Namibian Sand Sea.</span></p><span class="wysiwyg-color-white">\r\n</span><p><span class="wysiwyg-color-white">He activated the Hill Descent Control (HDC) right before he slid down the famous sand dunes with BMW X5. The HDC is a smart system that holds the vehicle at a pre-determined speed and helps it''s brake control so the driver can fully concentrate on the steering wheel. </span></p>', 'f04c3e74ddc274e57dc08939105fc1cb.jpg', '', '', '', 'center', '2015-03-09 14:11:45', 2),
(245, 85, '<p><span class="wysiwyg-color-white">Impressed with the HDC capability, he could also feel the xDrive system adapts perfectly on the way back route that leads him through high extensions of desert dunes and the dry river delta of the Kuiseb River. The xDrive is an intelligent system that drives all the wheels, managing the distribution of the driving force to front and rear wheels for the most challenging road surface conditions. </span></p><span class="wysiwyg-color-white">\r\n\r\n</span><p><span class="wysiwyg-color-white">This entire exhilarating journey ended in Windhoek. Yennas has never expected his first Namibian epic journey was full of unexpected joy and surprises - especially when he experienced it behind the wheel of BMW X5. Definitely a perfect driving experience every BMW enthusiast is looking for.  </span></p>', 'beb9a6e95d9db1b592e9baef510df487.jpg', '', '', '', 'center', '2015-03-09 14:11:45', 2),
(247, 106, '<h2>DISCOVER X IN <br> UNEXPECTED PLACES.</h2>\r\n                            <p>With the multi-terrain abilities, X Family  ensure driving pleasure even in tough condition, you know, like dessert of Mount Bromo. </p>\r\n    \r\n    <p>Leave your daily live behind and enjoy our two days exciting journey to Bromo, Indonesia which uniquely combines comfort and a spectacular outdoor experience with BMW Destination X.  From  gravel and sand track in foggy morning to a challenge X-track and X-treme ride on a beautiful Sea of Sand at mount Bromo, the BMW Destination X is designed to give you a joyful journey to remember. </p>\r\n    \r\n    <p>Sometimes you need to go to unexpected places to find your "X".</p>\r\n                            <a href="http://beta.mybmw.co.id/public_assets/brochure/MyBMW-Namibia-eBrochure.pdf" target="_blank" class="button btnblue register">Registration</a>\r\n                            <a href="http://beta.mybmw.co.id/public_assets/brochure/MyBMW-Namibia-eBrochure.pdf" target="_blank" class="button btnnobg download"><span class="icon-download">&nbsp;</span> Download E-Brochure</a>', 'd00370768a6256194a825f327b8110da.jpg', '', '', '', '', '2015-03-09 14:21:32', 2),
