(490, 128, '<h2>DISCOVER X IN UNEXPECTED PLACES WITH BMW X MODEL RANGE.</h2><br><p>Its time to leave the paved roads of the city and dig your tires into the sand. With the multi-terrain abilities, BMW X model range ensure driving pleasure even in tough condition and you will find the X side of Mount Bromo. From gravel and sand track in foggy morning to a challenge X-track and X-treme ride on a beautiful Sea of Sand at mount Bromo, the BMW Destination ''X'' â€“ Bromo Driving Xperience is designed to give you a joyful journey to remember. </p><br><br><p>Sometimes you need to go to unexpected places to find your "X". Download the e-brochure or register now to start your unexpected journey and find your "X".</p>', 'a7fc150d555357c3be5a1eefb60c94aa.jpg', 'b1970eee387d61d44581504eaa60547b.jpg', '4e9676d234b1033f1244ae46ec8a4628.jpg', '430c42d61b4486b04da5bf63d57a36d2.jpg', 'left', '2015-03-16 10:41:45', 2),
(567, 112, '<h2>AN UNEXPECTEDLY JOYFUL JOURNEY IN NAMIBIA WITH THE OUTSTANDING BMW X5.</h2>\r\n                        <p>"My exploration in the wilderness of Namibia has never been so exhilarating with BMW X5. Get in touch with the local, roaming in the desert and a surprise dinner under the starry-skied night are just a glimpse of my exciting journey. " <br><br>â€“ Yennas Chandra â€“</p>\r\n<br>\r\n<a href="http://mybmw.co.id/drivingexperienceregistration" target="_blank" class="button btnblue jointhetour">Keep Me Informed</a>', '170d6b039c9d68f3724187ef5e2656d6.jpg', 'af975caf3c475a83cbecda810529d009.jpg', '7993a42600c6905bddee4bd4ef60fb49.jpg', '258760a019bb98c7d3c0be3e7b9f9194.jpg', 'left', '2015-12-02 13:23:07', 1);
