(568, 112, '<p><span class="     wysiwyg-color-white">Away from the asphalt roads, on gravel tracks through sand dunes and dried river deltas, I finally discovered a whole new dimension of driving pleasure behind the wheel of BMW X5. Now I know why BMW X5 is definitely not your regular SUV.</span></p><span class=""><span class="   wysiwyg-color-gray">\r\n</span><p><span class="     wysiwyg-color-white">Before setting off across the X-routes, I was  introduced to the instructor. He s a senior manager at BMW who is in charge of the car technology development for the next 10 years. According to his statement, the X5 series were not meant for a very extreme off-road use, such in Namibia. But once I experienced its astounding performance myself, I could prove him wrong. It took me by surprise how the X5 could really conquered all type of terrains even to the most extreme one!</span></p><span class="     wysiwyg-color-white">\r\n</span><p><span class="     wysiwyg-color-white">I could easily adapt to the BMW X5 steering wheels in no  time. The handling is very light, easy to control and comfortable as if I was  driving on a regular road. While in fact, we drove about 1400 km traversing through varied terrains from the sand desert, gravel and rocky roads, dried river beds, grass fields and asphalt roads. Not mentioning the steep hill up to the mountain and down the hill. And from all those bumpy uneven tracks didnt even bother my co-driver to take a nap comfortably besides me! Wow! Can you imagine how powerful and versatile the X5 is?</span></p></span><span class="   wysiwyg-color-gray">   </span><span class="wysiwyg-color-gray"> </span> <span class="wysiwyg-color-silver"></span> <span class="wysiwyg-color-white"></span>', 'dc1509afe8bc20bf8da2362000b0c294.jpg', '6c64929ffa7adb0f38bad4231eca904e.jpg', 'f7ad91d1e414f4b82c25404fd93fe90c.jpg', '48a09aecba413c8c245e036624901261.jpg', 'center', '2015-12-02 13:23:07', 1),
(569, 112, '<p><span class="">The first route was quite a challenge. We were driving in to the small road with African plants along the road. Too bad we couldnt avoid the sharp branches from scratching the X5 exterior, but soon as we arrived, I found out that the quality of its paint has miraculously kept the scratch away. Very impressive!</span></p><span class="">\r\n</span><p><span class="">The other route was even more exciting. We traveled through dried river beds into the Erongo Mountains over the sand, rubble and rocks for an exotic surprise dinner at the top of the rocky hill. It was definitely one of the most unexpected and very memorable moments from this journey. After the joyful under the starry-skied dinner, I couldnt hide my amazement when we visited the Sandwich Harbor on the next day. Its a towering giant sand dunes that run straight into the ocean, yes, the famous Namibian Sand Sea!</span></p>', 'd759d3a1a8c26f93d2e355702235680d.jpg', '585650bc5b720494c92165b7f5396662.jpg', '0816d1c622c0d7bbaf642f5a85aae805.jpg', '42f5f0c6574fc732a79f55274609a2f9.jpg', 'center', '2015-12-02 13:23:07', 1),
(570, 112, 'Along this journey I''ve learned and quite understand about BMW philosophy. My instructor explained why they only implement the best technology on BMW. BMW will always produce a car with 100% proven quality, no 70% or less.<br><br>Well, I never thought my first Namibian journey will be unexpectedly joyful. The scenery was beyond spectacular, the food was great and I had a very kind yet spontaneous instructor. Everything was very well planned and full of wonderful surprises.<br><br>BMW Driving Xperience is the perfect kind of trip for people who would like to explore Namibia. I donâ€™t think any regular travel agent will give you such exhilarating experience as BMW will give you.<br><br>Thank you for the unforgettable driving experience.<br>Best Regards,<br>Yennas Chandra<br><br>', '776ee597b6ffaf80f1c1c0a9fbdf0e02.jpg', '3523d448eaf4ac31669d32872085c84a.jpg', 'c0bb9b31371d4e696852fac2ec29aea7.jpg', '187f381420510108a36f930bce827e2e.jpg', 'center', '2015-12-02 13:23:07', 1),
(579, 110, '<h2>BMW DRIVING EXPERIENCE 2016.<br>WINTER DRIVING ARJEPLOG, SWEDEN.</h2><h4>THE REASON FOR ADVENTURE BEGINS NOW.</h4><br><br>\r\n<p><span style="font-weight: normal;">BMW invites you to experience winter through &nbsp;</span><span style="font-weight: normal;">wide-open spaces of the rugged landscape in &nbsp;</span><span style="font-weight: normal;">Sweden on 23 â€“ 27 February 2016 to drive&nbsp;</span><span style="font-weight: normal;">dynamic, high-speed drifts. Discover a thrilling&nbsp;</span><span style="font-weight: normal;">experience behind the wheel of a BMW M4&nbsp;</span><span style="font-weight: normal;">CoupÃ© that guarantees spectacular and&nbsp;</span><span style="font-weight: normal;">unforgettable memories.</span></p>', 'c8c390f758cebe56c5a1f31fc9b27dd9.jpg', '', '', '', 'left', '2015-12-07 18:49:55', 1),
(580, 110, 'Receive 15% off and 0% 3 months instalment with<br>HSBC Premier MasterCard and HSBC Visa Signature. <br>Valid at Turkish Airlines ticketing offices in Jakarta.<br><br>\r\n<a href="http://mybmw.co.id/drivingexperienceregistration" target="_blank" class="button btnblue jointhetour">Keep Me Informed</a>&nbsp;&nbsp;\r\n<a title="Link: http://mybmw.co.id/assets/download/Sweeden_Brochure.pdf" href="http://mybmw.co.id/assets/download/Sweeden_Brochure.pdf" class="button btnnobg" target="_blank"><span class="icon-download"></span>&nbsp;Download E-Brochure</a>', '2b6c6efcd48c8714cc752df0e64393bb.jpg', '', '', '', '', '2015-12-07 18:49:55', 1),
(581, 111, '<h2>BMW DESTINATION X.<br>BROMO DRIVING EXPERIENCE.</h2>\r\n<p>One word comes to mind when talking about Bromo: epic.  Cruising in the sea of sands, catching magical sunrise, enjoying the breathtaking  landscapes of Mount Bromo are some the exciting experiences you might get on this journey. This majestic mountain sits in the Tengger Massif, a volcanic complex surrounded by a vast sea of black sand. It may not be the highest, but it is the most popular, and definitely the most interesting destination to embark upon.<br></p><p>However, during this journey, you will be challenged to explore the X side of Mount Bromo behind the BMW X model range. So, gear up your adrenaline and conquer the routes!<br></p>\r\n', 'd446343a79d0b972b3bc9c523bdd4586.jpg', '29b1fa24dcbc47138273bc118d494a66.jpg', '4583d55f53ac603fba4e8bf14abc7d03.jpg', '57975704bbd8973face7b3c210fd6885.jpg', 'left', '2016-01-20 16:09:00', 1),
(582, 111, '<h2>DISCOVER X IN UNEXPECTED PLACES WITH BMW X MODEL RANGE.</h2>\r\n<p>It''s time to leave the paved roads of the city and dig your tires into the sand. With the multi-terrain abilities, BMW X model range ensure driving pleasure even in tough condition and you will find the X side of Mount Bromo. From gravel and sand track in foggy morning to a challenge X-track and X-treme ride on a beautiful Sea of Sand at mount Bromo, the BMW Destination X â€“ Bromo Driving Experience is designed to give you a joyful journey to remember. </p>\r\n\r\n<p>Sometimes you need to go to unexpected places to find your "X".<br></p>', '98d66256c0c394aa486ac333f0b671b7.jpg', '02d3b3f533435ae6a4a1fe3423ac39a4.jpg', '266c0114884996e241896465e459fb50.jpg', '8051dd1aaaf93f9c89459a58e652295e.jpg', 'left', '2016-01-20 16:09:00', 1);
